import React, { useEffect } from "react";
import {
  Box,
  Text,
  Table,
  Thead,
  TableContainer,
  Th,
  Tr,
  Td,
  Tbody,
  Image,
  Button,
  useDisclosure,
  Modal,
  ModalBody,
  ModalContent,
  ModalOverlay,
  ModalHeader,
  ModalCloseButton,
  ModalFooter,
  Input,
  VStack,
} from "@chakra-ui/react";
import {
  Get_solarpanel_item,
  UPDATE_solarpanel_item,
  REMOVE_solarpanel_item,
} from "../../../redux/solarpanel/solarpanel.action";
import { useDispatch, useSelector } from "react-redux";
import { RiDeleteBin5Fill } from "react-icons/ri";

const Solarpanel = () => {

        // admin page solar compnet   
  const [id, SetId] = React.useState("");
  const [price, SetPrice] = React.useState("");
  const { solarpanel } = useSelector((state) => state.solarpanel);

  const dispatch = useDispatch();
  const { isOpen, onOpen, onClose } = useDisclosure();

  useEffect(() => {
    dispatch(Get_solarpanel_item("",[]));
  }, [dispatch]);

  const newprom = async () => {
    setTimeout(() => {
      dispatch(Get_solarpanel_item("",[]));
    }, 2000);
  };               
  // ----------------------------function handleUpdate-------------------
  function handleUpdate() {
    const changes = {
      price: price,
    };
    dispatch(UPDATE_solarpanel_item(id, changes));
    newprom();
    onClose();
  }
  // ---------------------------function handleRemove----------------------
  function handleRemove(id) {
    dispatch(UPDATE_solarpanel_item(id));
    newprom();
  }
  return (
    <div>
      <Box w="100%" h="auto" p={10} bgColor="#f7f7f7 ">
        <Box>
          <Text textStyle="DashboardHead">SOLAR PANELS</Text>
          <TableContainer>
            <Table variant="striped" colorScheme="blue">
              <Thead>
                <Tr>
                  <Th>ORDER ID</Th>
                  <Th>NAME</Th>
                  <Th>PRICE</Th>
                  {/* <Th>COMPANY</Th> */}
                  <Th>IMAGE</Th>
                  <Th>UPDATE</Th>
                  <Th>REMOVE</Th>
                </Tr>
              </Thead>
              <Tbody>
                                             {/* ----------------------------- Product Page-------------------- */}
                {solarpanel.solarpanel&&solarpanel.solarpanel.map((el) => (
                  <Tr key={el.id}>
                    <Td>{el.id}</Td>
                    <Td>{el.name}</Td>
                    <Td>â‚¹{el.price}</Td>
                    {/* <Td>{el.company}</Td> */}
                    <Td>
                      <Image src={el.img_src} alt={el.id} />
                    </Td>
                    <Td>
                      <Button onClick={()=>{onOpen()
                      SetId(el._id)
                      }}>Update</Button>
                    </Td>
                    <Td onClick={() => handleRemove(el._id)}>
                      <RiDeleteBin5Fill />
                    </Td>
                  </Tr>
                ))}
              </Tbody>
            </Table>
          </TableContainer>
        </Box>

        <Modal isOpen={isOpen} onClose={onClose}>
          <ModalOverlay />
          <ModalContent>
            <ModalHeader>Update Item</ModalHeader>
            <ModalCloseButton />
            <ModalBody>
              <VStack spacing={5}>
              
                <Input
                  placeholder="Enter New Price"
                  value={price}
                  onChange={(e) => SetPrice(e.target.value)}
                />
              </VStack>
            </ModalBody>

            <ModalFooter>
              <Button colorScheme="blue" mr={3} onClick={handleUpdate}>
                Update Product
              </Button>
            </ModalFooter>
          </ModalContent>
        </Modal>
      </Box>
    </div>
  );
};

export default Solarpanel;
